const mausHeadAdd=document.getElementById("s2-0"),aroow=document.querySelector(".s1__block2"),mausHead=document.querySelector(".active_van"),activContent=document.querySelector(".active_van"),activContentVan=document.querySelector(".active_van2"),divActive=()=>{aroow.classList.remove("s1__block2_active2"),activContent.classList.add("delet"),activContentVan.classList.remove("delet")};let textConcept=document.getElementById("concept"),textResults=document.getElementById("results"),btnNextProCase=document.getElementById("btn_next_project"),imgCase=document.getElementById("img_case");const textProject=[];project1={text1:text1="<br><br>В рамках продвижение бренда воды “ГОРНАЯ”, нами был разработан масштабный маркетингово-коммуникационный комплекс 360 в который входил полный спектр инструментов: от Digital и ТВ ротации до активации с Influencers. В несколько проектных этапов мы:<br><br>- провели первичный анализ рынка, конкурентов и выявили необходимые специфики<br>- разработали и согласовали бренду концепцию и слоган: “ПЕЙ ГОРНУЮ - БОЛЕЙ ЗА СБОРНУЮ!”<br><br>Концепция вода и спорт всегда останется выигрышной и понятной. Мы усилилили её, выстроив позиционирование на Олимпийском спорте и олимпийских спортсменах. Концепция ився последующая рекламная кампания были согласованы нами с Олимпийским комитетом России.<br><br>- подобрали пул абмассадоров<br>В пул бренда мы отобрали самых результативных и ярких представителей Олимпийской сборной РФ: Артур Далалоян, Яна Егорян, Дженнифер Акиниймика и Гаджимурад Рашидов.<br>- разработали и сняли серию рекламных роликов для Digital и ТВ Ротации<br>В единой концепции и стилистике провели сьёмки 4 рекламных роликов с каждым спортсменом “ГОРНОЙ” и запустили 5-ти месячную рекламную кампанию на федеральных каналах: Первый, Россия 1 и МАТЧ ТВ с охватом более 12.000.000 человек<br> - подготовили стимулирующую акцию, которая познакомила и вовлекла аудиторию в жизнь Бренда, а также позволила стимулировать продажи в целевом регионе.<br><br> Стимулирующая акция “ПЕЙ ГОРНУЮ - БОЛЕЙ ЗА СБОРНУЮ” призывала поделится словами поддержки спортсменам Олимпийской сборной, перейдя на промо-сайт акции и скопирую уникальную открытку с изображением спортсмена.<br> Реализация данного комплекса дала нам все условия для расширению бренда ГОРНАЯ на полке ретейлера и выполнения торговых KPIs согласованных сзаказчиков.",text2:text2="Увеличение узнаваемости бренда в целевом регионе на 86,5 % Первое место в сегменте “Вода” по обьёму ТВ и Digital рекламы <br>Увеличение продаж после проведения стимулирующей акции в целевом регионе на 47,5% ",img1:img1="img/gornaya1.jpg"},project2={text1:text1="Мечтай с душой ! Воодушевившись сюжетом мультфильма от Disney «Душа», в котором главный герой попадает в мир, где зарождаются человеческие увлечения, мечты и интересы, Splat призывает нас не бояться мечтать и запускает конкурс совместно с торговой сетью «Лента», который позволит осуществить самые заветные мечты участников",text2:text2="Подобрали лица рекламной кампании.Кто может рассказать более мотивирующую историю, чем звезды спорта?Именно поэтому мы выбрали самых подходящих по критериям аудитории, средними охватами и личным брендом спортсменов:Александр Большунов – чемпион мира, четырехкратный призер Олимпийских игр по лыжным гонкам; Дина и Арина Аверины – тринадцатикратные чемпионки мира, шестикратные чемпионки Европы по художественной гимнастике Алина Балашова – звезда отечественной сноуборд индустрии<br><br>Сформировали промо материалы: Каждая история уникальна, но при этом должна полностью отражать посыл рекламной кампании. Это отлично подчеркнули архивные фотографии становления спортсменов, которые фактически иллюстрировали копирайтинг поста и усилили впечатление истории. <br><br>В конце карусели, мы добавили нативную фотографию с продукцией и спортсменами, подводя тем самым концептуальный итог истории, фокусируя внимание на бренде.",img1:img1="img/project/project12/main.jpg"},project3={text1:text1="Подписание и сопровождение контракта абсолютного чемпиона UFC Хабиба Нурмагомедова и Toyota motor. Масштабирование контракта за пределы Российской Федерации, покупка рекламных активаций Toyota Объединенные Арабские Эмираты.",text2:text2="Повышение узнаваемости бренда, увеличение охватов рекламных постов бренда более чем в 10 раз, повышение уровня продаж в Восточной части РФ, предоставление самой крупной рекламной площадки в российском Instagram для рекламной кампании новой линейки внедорожников TRD, повышение и заинтересованности и доверия крупного бизнеса к клиенту.",img1:img1="img/habib.jpg"},project4={text1:text1="Реализация презентации фильма о мировом сноубординге Channel Zero",text2:text2="- Подбор и согласование площадки мероприятия Фудмолл Депо;<br><br>- Разработка платформы по покупке билетов с возможностью внедрения торговой акции;",img1:img1="img/canel.jpg"},project5={text1:text1="Подписание и сопровождение рекламного контракта западного бренда одежды класса Luxe – Billionaire и ведущего промоушена смешанных единоборств Fight Nights Global.",text2:text2="Повышение узнаваемости, привлечение новой целевой аудитории к бренду.<br><br>- Охват рекламной кампании с интеграцией бренда Billionaire на МАТЧ ТВ – 4 185 000 человек;<br><br>- Охват рекламной кампании в social media более 1 500 000 человек;<br><br>- Конверсия BTL акции - 25,6 %, в рамках данной BTL акции конверсия высчитывается исходя из количества переходов с QR кодов на посадочную страницу Billionaire;<br><br>- Амбассадор рекламной кампании – спортивный функционер, общественный деятель, президент промоутерской компании «Fight Nights Global» – Камил Гаджиев",img1:img1="img/fn.jpg"},project6={text1:text1="Реализация мастер-классов чемпиона мира, призера Олимпийских игр по хоккею – Алексея Яшина на ГУМ Катке при поддержке Федерального проекта «Спорт - норма жизни»",text2:text2="Организация и проведение мастер-классов;<br><br> Разработка айдентики проекта;<br><br> Разработка промо-страницы мероприятия;<br><br> SMM сопровождение проекта;<br><br>   Привлечение региональных и федеральных СМИ",img1:img1="img/yashin.jpg"},project7={text1:text1="Wabi Sabi короткометражный экшн-спорт фильм Евгения Иванова о большом путешествии в посках потерянной красоты, о его личном творческом пути, основой и ключом развития стало внетрассовое катание в больших горах. Это бесконечное путешествие в поисках новых маршрутов с целью найти уникальные рельефы для катания. Это уникальная история, которая будет интересна не только профессиональным представителям сноуборд-культуры, но и простым любителям, вдохновляющимся экстремальными видами спорта",text2:text2="Презентацию фильма посетили более 700 человек, более 30 лидеров общественного мнения и молодежных блогеров, собрано более 800 постов в социальных сетях, показ фильма продолжается в регионах России",img1:img1="img/co.jpg"},project8={text1:text1="Первая в России хоккейная лига среди сборных команд офицеров и ветеранов России, а так же государственных гражданских служащих и других представителей органов государственной власти, созданная с целью поддержки и развития детского, юношеского и любительского спорта Российской Федерации, патриотического воспитания молодежи и популяризации здорового образа жизни среди офицеров и гражданского населения страны.",text2:text2="- Разработали PR стратегию ОХЛ;<br><br>- Организовали официальное открытие ОХЛ в Олимпийском комитете России;<br><br>- Привлекли и провели интеграцию коммерческих партнеров;<br><br>- Организовали матч закрытия сезона 2018-2019 в ледовом дворце ЦСКА<br><br>USM Group сопровождает ОХЛ в рамках PR стратегии и event маркетинга, мы делаем уровень профессионального спорта доступным для всех любителей, а также красочные события для неравнодушных людей на трибунах.",img1:img1="img/oficer.jpg"},project9={text1:text1="Организация event на волне хайпа.<br><br>Откровенный разговор Давидыча на программе Вдудь содрогнул спортивную общественность.",text2:text2="- Разработка Pr стратегии<br><br>- Подбор площадки проведения мероприятия;<br><br>- Оформление площадки;<br><br>- Привлечение и интеграция коммерческих партнеров<br><br>- Привлечение блогеров и спортивных деятелей",img1:img1="img/davidich.jpg"},project10={text1:text1="Music Cycle Festival – крупнейшее событие, объединяющее любителей разных современных спортивных направлений на одной площадке с самыми лучшими тренерами мирового уровня в едином прорыве: Cycle, Zumba, Salsation, Kangoo, Jumps",text2:text2="Всего в мероприятии приняли участие более 800 человек из 15 регионов России, привлекли более 5 коммерческих партнеров.<br><br>По итогам мероприятия вышло более 50 публикаций в СМИ и 120 публикаций в социальных сетях",img1:img1="img/musics.jpg"},project11={text1:text1="Организация Фестиваля в целях продвижения туристско-рекреационного потенциала Республики Дагестан на Российский и международные рынки, ознакомлением посетителей мероприятия с уникальными культурными и национальными традициями народов и регионов. В мероприятии приняли участие жители Республики Дагестан, представители более 190 народов из субъектов Российской Федерации. В рамках Мероприятия прошли мастер-классы по народно-художественному мастерству Республики, спортивные состязания, концертная и развлекательная программа, а также круглые столы, тематикой которых стали взаимодействие туристических кластеров между регионами, этнобрендирование, обмен этнотурестическим медиаконтентом, медиакоммуникации в некоммерческом секторе",text2:text2="- Разработка концепции мероприятия;<br><br>- Разработка коммуникационного плана продвижения проекта;<br><br>- Разработка брендбука мероприятия; <br><br>- Разработка сайта проекта;<br><br>- Создание видео контента;<br><br>- Создание и ведение social media;<br><br>- Привлечение СМИ;<br><br>- Организация форумной части с участием спикеров;<br><br>- Организация концертной программы; <br><br> - Организация экскурсионных программ;<br><br>- Организация логистических решений",img1:img1="img/kaspiy.jpg"},project12={text1:text1="Вывод на рынок и развитие Лыжно-биатлонного комплекса «Зимний клуб Forest Hills», основной направленностью которого является активный зимний отдых и профессиональная подготовка спортсменов по зимним видам спорта.",text2:text2="Forest Hills зарекомендовал себя, как лыжный центр, который предоставляет качественные услуги в сегменте лыжного спорта и зимнего отдыха, открытие Зимнего клуба посетило более 600 человек, на мероприятии присутствовало 5 Олимпийских чемпионов и призеров Олимпийских игр, провели более 5 профильных offline событий, амбассадорами Зимнего клуба стали выдающиеся спортсмены и бизнесмены.<br><br> По итогам работы вышло более 50 публикаций в СМИ и более 200 в социальных сетях",img1:img1="img/zima.jpg"},project13={text1:text1="Серии лыжных гонок, расширяющих свою географию ежегодно, для любителей активного время провождения, позволяющая почувствовать себя профессионалом, не только благодаря уровню организации проекта, а также кубковому зачету и финалу в гору, по аналогии с лучшими международными профессиональными стартами Tour De Ski",text2:text2="- Придумали и разработали event не имеющий аналогов в любительском лыжном спорте России.<br><br>- Разработали pr стратегию мероприятия;<br><br>- Привлекли 4х олимпийских чемпионов по лыжным гонкам в рамках celebrity маркетинга<br><br>- Организовали 4 event в разных городах в рамках.<br><br>- Привлекли и интегрировали более 5 коммерческих партнеров<br><br>- Организовали работу волонтерского корпуса.",img1:img1="img/monsters.jpg"},textProject.push(project1,project2,project3,project4,project5,project6,project7,project8,project9,project10,project11,project12,project13);for(let e=0;e<textProject.length;e++)textVan=textProject[e];let indSlid=-1;function nextProject(){12===indSlid?indSlid=-1:(imgCase.classList.add("img_case__active"),btnNextProCase.classList.add("btn__position_case__active"),indSlid+=1,imgCase.src=textProject[indSlid].img1,textConcept.innerHTML=textProject[indSlid].text1,textResults.innerHTML=textProject[indSlid].text2)}